import React from "react";
import { ICoins } from "../../models";
import CoinItem from "../CoinsItem/CoinItem";
import "../Coins/Coins.css";
import { Link } from "react-router-dom";
import Coin from "../Coin/Coin";

interface IPropsCoins {
  coins: ICoins[];
}

export default function Coins(props: IPropsCoins) {
  return (
    <>
      <div className="heading-wrapper">
        <div className="heading">
          <div className="description">
            <p className="cap-rank">#</p>
            <p className="cap-logo">Logo</p>
            <h1 className="coin-name">Name</h1>
          </div>
          <div className="description-data">
            <p className="description-price">Price</p>
            <p className="description-volume">Volume</p>
            <p>description-marketcap</p>
          </div>
        </div>
      </div>
      <div className="description-row">
        {props.coins.map((coins) => {
          return (
            <Link to={`/coin/${coins.id}`} key={coins.id}>
              <CoinItem coins={coins} />
            </Link>
          );
        })}
      </div>
    </>
  );
}
